import Footer from "./Footer";
import Header from "./Header";

const Intro = () =>{
return(
<div>
<Header />
<div class="mainimg">이미지영역</div>

<div class="btn-group" role="group" aria-label="Basic mixed styles example">
  <button type="button" class="btn btn-tutorial">튜토리얼</button>
  <button type="button" class="btn btn-start">시작하기</button>
  <button type="button" class="btn btn-metamask">메타마스크로 이동</button>
</div>
<Footer />
</div>
)
}

export default Intro;
